import React from 'react';
import {
  Container, 
  ImageProduct, 
  PaymentBox,
  InfosProduct,
  InfoLeft,
  ColumnTitle,
  Description,
  InfoRight
} from './styles';

function CheckoutDesktop(props) {
  const { product } = props
  return (
    <Container>
      <ImageProduct>
        <img src={product.MaxresURL} alt="Product" />
      </ImageProduct>
      <PaymentBox>
        <InfosProduct>
          <InfoLeft>
              <ColumnTitle>Cart total</ColumnTitle>
              <Description>
                <p>{product.description}</p>
                <p>
                  x 1, {product.color}, Size {product.size}
                </p>
                <p>Item #{product.id}</p>
              </Description>
          </InfoLeft>
        </InfosProduct>
      </PaymentBox>
    </Container>
  );
};

export default CheckoutDesktop;
